import React from 'react';
import { Card, Row, Col } from 'react-bootstrap'
import '../index.css'

const Listitem = ({ Data }) => {
    return (
        <>

            <Row>
                {Data.length >= 1 ? (Data.map((ele) => {
                    return  (
                        console.log(ele)
                    )
                })) : <p>لا يوجد بيانات</p>}

                    <Col sm="12">
                        <Card className='mt-4'>
                            <div className='d-flex flex-wrap'>
                                <Card.Img variant="top" src="../imges/haute-cuisine_538646-1494.jpg" className='img' />
                                <Card.Body>
                                    <div className='d-flex  justify-content-between'>
                                        <Card.Title>Card title</Card.Title>
                                        <p style={{ color: 'brown', fontSize: "20px" }}>50 جنيه</p>
                                    </div>
                                    <Card.Text>
                                        This card has supporting text below as a natural lead-in to
                                        additional content.
                                    </Card.Text>
                                </Card.Body>
                            </div>
                        </Card>
                    </Col>
                </Row>
        </>
            )
}

            export default Listitem;
